import React from 'react'
import {bankOne, bankTwo} from './banks'

function Clavier() {
    return (
        <div className='display'>
            {bankOne.map(note => (
                <p key className='drum-pad'>{note.keyTrigger}</p>
            ))}
        </div>
    )
}

export default Clavier
